import React from 'react';
import { Form } from "semantic-ui-react";
import { useFormi} from "formik";

export function LoginForm() {
  return (
    <Form>
        <Form.Input name="email" placeholder="Informe o e-mail!" />
        <Form.Input name="password" type="password" placeholder="Informe a senha!" />

        <Form.Button type="submit" primary fluid>
            Entrar
        </Form.Button>
    </Form>

  )
}
